import React from 'react';
/* eslint-disable */
class JsonTable extends React.Component {

    constructor(props) {
        super(props);
    }
    render() {
        return (

             <table>
             <tbody>{this.props.data.request_data.map(function(item, key) {

                      return (
                         <tr key = {key}>
                             <td>{item.course_name}</td>
                             <td>{item.location}</td>
                             <td>{item.professor}</td>
                         </tr>
                       )

                    })}</tbody>
              </table>
              /*<table>
              <td>{JSON.stringify(this.props.data.request_data)}</td>
              </table>*/
        )
    }
};

export default JsonTable;
